import React from 'react';
import {BrowserRouter, Route, Routes} from "react-router-dom"
import Home from './Home';
import DrugInputs from './DrugInputs';
import ViewDrugs from './ViewDrugs';


function App() {
  return (


      <Routes>
         <Route path="/" element={<Home/>}> </Route>
         <Route path="/DrugInputs" element={<DrugInputs/>}> </Route>
         <Route path="/ViewDrugs" element={<ViewDrugs/>}> </Route>
      </Routes>



  )
}

export default App;
